import React from 'react';
import { View, Text } from 'react-native';
import styles from './styles';

const Entrar = () => {
  return (
    <View style={styles.container}>
      <Text style={styles.textoBoasVindas}>Tela de Entrar</Text>
    </View>
  );
};

export default Entrar;
